import contextlib
from .utils import kebab_to_pascal

@contextlib.contextmanager
def Icon(name):
    
    if isinstance(name, str):
        fn_name = kebab_to_pascal(name)

        icon_cls = globals().get(fn_name)

    with icon_cls(): pass
    
    yield